
#        Document Title: example-medium.cfg
#               Subject: SPEC CPU2006 Example Config file (Medium complexity)
#          Last updated: 28 Apr 2011 cds

# ------------------------------------------------------------------------

# This is an example CPU2006 config file.  It does not use advanced
# features of the tools, but it does illustrate a config file that has
# sufficient information for a reportable SPEC CPU2006 run for both
# integer and floating point results, including all hardware and
# software information needed for the full disclosures.

#
# You can try a "fake" reportable run with this config file to see what
# reporting looks like.  You don't need to have the hardware or software
# described here - just a CPU2006 kit.  Try this:
#
#     runspec --config Example-medium --fakereportable 
#

#> SPEC CPU2006 tuning for dl585-hpc-server 
#> D. Schmidt 6 Feb 06
#>
#> Comments that start with "#>" are "protected comments" -- i.e. 
#> they do not get included in the rawfile's version of this config 
#> file.  Use protected comments for proprietary information.
 
#####################################################################
# System Under Test (SUT) Section
# If it affects performance, you need to describe it, either
# in the pre-defined fields or by adding it to the notes section.
#######################################################################
# default sysinfo is expected to write hw_cpu_name, hw_memory, hw_nchips,
# hw_disk

# System Description 

hw_avail           = Dec-9999
hw_model           = ProLiant DL585 (AMD Opteron 852)
hw_other           = None
hw_vendor          = Hewlett-Packard Company

# CPU description 
# For an explanation of how to count CPUs, see
# http://www.spec.org/cpu2006/Docs/runrules.html#cpucount

#hw_cpu_char       (not needed: see run rule 4.2.2)
hw_cpu_mhz         = 2600
hw_fpu             = Integrated
hw_ncores          = 4
hw_ncoresperchip   = 1
hw_ncpuorder       = 2, 4 chips
hw_nthreadspercore = 1
hw_pcache          = 64 KB I + 64 KB D on chip per chip
hw_scache          = 1 MB I+D on chip per chip
hw_tcache          = None
hw_ocache          = None

# Tester description - edit the date, put your license number here!

license_num        = 0
#test_sponsor      (not needed: default is same as hw_vendor)
#tester            (not needed: default is same as test_sponsor)

# Operating system, file system
# default sysinfo is expected to write prepared_by, sw_os, sw_file, sw_state

sw_other           = None

# Special notes
# 
# You can write many kinds of notes, as described at 
#     www.spec.org/cpu2006/Docs/config.html#sectionV.C
#
# For example, you could remove the comment marks below if 
# you were using the referenced patch kit.
#
#notes_os002  = Information on Novell SuSE service pack 2 is available at 
#notes_os003  = http://support.novell.com/techcenter/search/search.do?cmd
#notes_os004  = displayKC&externalId=3d748c1026d0427d7912a508e8ecc3afhtml
#notes_os005  = (you'll need to cut/paste the above URL halves)

# OS Date
#       Use the "sw_avail" line here only if the OS you are testing ships 
#       later than the compilers (and then comment out their availability 
#       dates, below!)  Notice that the field "sw_avail" occurs 3 times 
#       in this file, but only one should be used on a given run: 
#
#           1. the OS date (if later than the compilers), or
#           2. the Integer compiler date (later of C, C++), or
#           3. the FP compiler date (latest of C, C++, Fortran, or AMD
#              core math library.)

# sw_avail        =

#######################################################################
# End of SUT section
# If this config file were to be applied to several SUTs, edits would
# be needed only ABOVE this point.
######################################################################


######################################################################
# The header section of the config file.  Must appear
# before any section markers (i.e. instances of "default=")
# (For an explanation of how section markers work, see 
# www.spec.org/cpu2006/Docs/config.html#sectionI.C.3 )

ext           = DL585_08_2005
output_format = text,html,pdf,config
table         = 0
teeout        = no
tune          = all
reportable    = 1
runlist       = int fp
flagsurl      = http://www.spec.org/cpu2006/flags/pathscale32-flags.xml

######################################################################
# Compiler selection, versions, and dates.
# C and C++ is used in both CINT2006 and CFP2006, so their information 
# appears under
#         default=default=default=default:
# whereas Fortran is used only for floating point and is described 
# only under
#         fp=default=default=default:
#
# When setting the date, please see the comments above under "OS Date".
# Remember, it's the LAST compiler in a set whose date should be listed.  

default=default=default=default:
sw_compiler  = PathScale EKO Compiler Suite, Release 2.4 

CC           = pathcc      
CXX          = pathCC

int=default=default=default:  
sw_avail     = Dec-9999

fp=default=default=default:
sw_avail     = Dec-9999
sw_compiler2 = AMD Core Math Library 3.0.0

FC           = pathf95

#######################################################################
# Integer Baseline Optimization

int=base:
OPTIMIZE     = -O3
COPTIMIZE    = -ffast-math 
CXXOPTIMIZE  = -fno-math-errno

# SPEC asks that the fields sw_base_ptrsize and sw_peak_ptrsize
# summarize what the selected tuning does for pointer sizes.  It 
# is probably easier to remember to set these fields correctly if 
# they are located next to the tuning that they summarize.
sw_base_ptrsize    = 64-bit

#######################################################################
# Integer Peak

int=peak:
sw_peak_ptrsize    = 32/64-bit
OPTIMIZE       = -O3 -OPT:Ofast 

# The following turns on feedback by default for all integer peak compiles.
# Generally, one needs to tell both the compilers and the linker about
# feedback flags, which is why there is repetition below.
PASS1_CFLAGS   = -fb_create fbdata
PASS1_CXXFLAGS = -fb_create fbdata
PASS1_LDFLAGS  = -fb_create fbdata
PASS2_CFLAGS   = -fb_opt fbdata
PASS2_CXXFLAGS = -fb_opt fbdata
PASS2_LDFLAGS  = -fb_opt fbdata

400.perlbench,401.bzip2,429.mcf,445.gobmk,456.hmmer=peak:
COPTIMIZE    = -ipa

471.omnetpp,473.astar,483.xalancbmk=peak:
CXXOPTIMIZE  = -ipa

458.sjeng=peak:
#> avoid -ipa because of known issue with this compiler version
#> (note the use of protected comments here: will not appear in
#> published result)

# (458.sjeng, and other benchmarks that are not explicitly mentioned with
# their own peak tuning -- namely 403.gcc, 462.libquantum, 464.h264ref --
# will get the tuning from the "int=peak:" section)

462.libquantum=peak:
# But we don't want feedback for libquantum.  It's easy to turn it off:
feedback=0

483.xalancbmk=peak:
PORTABILITY = 
OPTIMIZE    = -m32 -O3 -OPT:Ofast 

#######################################################################
# Floating point Baseline Optimization

fp=base:
sw_base_ptrsize    = 64-bit

OPTIMIZE     = -O3
COPTIMIZE    = -ffast-math 
CXXOPTIMIZE  = -fno-math-errno
FOPTIMIZE    = -OPT:div_split=on 

#######################################################################
# Floating Point Peak

fp=peak:
sw_peak_ptrsize    = 64-bit
OPTIMIZE     = -O3 -OPT:Ofast 
PASS1_CFLAGS   = -fb_create fbdata
PASS1_CXXFLAGS = -fb_create fbdata
PASS1_FFLAGS   = -fb_create fbdata
PASS1_LDFLAGS  = -fb_create fbdata
PASS2_CFLAGS   = -fb_opt fbdata
PASS2_CXXFLAGS = -fb_opt fbdata
PASS2_FFLAGS   = -fb_opt fbdata
PASS2_LDFLAGS  = -fb_opt fbdata

410.bwaves,416.gamess,434.zeusmp,436.cactusADM,437.leslie3d,454.calculix,459.GemsFDTD,465.tonto,481.wrf=peak:
FOPTIMIZE    = -ipa

433.milc,470.lbm=peak:
COPTIMIZE    = -ipa

447.dealII,453.povray=peak:
CXXOPTIMIZE  = -ipa

#######################################################################
# Integer Portability

int=default=default=default:
PORTABILITY = -DSPEC_CPU_LP64

400.perlbench=default=default=default:
CPORTABILITY = -DSPEC_CPU_LINUX_X64 

462.libquantum=default=default=default:
CPORTABILITY = -DSPEC_CPU_LINUX

483.xalancbmk=default=default=default:
CXXPORTABILITY = -DSPEC_CPU_LINUX

#######################################################################

fp=default=default=default:
PORTABILITY = -DSPEC_CPU_LP64

436.cactusADM=default=default=default:
FPORTABILITY = -fno-second-underscore

447.dealII=default=default=default:
CXXPORTABILITY = -DSPEC_CPU_TABLE_WORKAROUND

481.wrf=default=default=default:
FPORTABILITY= -fno-second-underscore
CPORTABILITY= -DSPEC_CPU_LINUX

#######################################################################
